import React, { Component } from "react";

let i = 0;

export class About extends Component {
  render() {
    let { title, desc, imgurl } = this.props;

    return (
      <div
        className="Container"
        style={{
          alignSelf: "1000px",
          width: "1000px",
          height: "100px",
          alignContent: "center",
        }}
      >
        <img src={imgurl} style={{ width: "100px", height: "100px" }} />
        News each components {title} {desc}
        {(i = i + 1)}
      </div>
    );
  }
}

export default About;
